/* -------------------------------------------------------
Variable font.
Usage:

  html { font-family: 'Inter', sans-serif; }
  @supports (font-variation-settings: normal) {
    html { font-family: 'Inter var', sans-serif; }
  }
*/

@font-face {
  font-family: 'Inter var';
  font-weight: 100 900;
  font-style: normal;
  font-named-instance: 'Regular';
  src: url("/0b1ebaf21ea10772a41e590d053b1304.woff2") format("woff2 supports variations(gvar)"),
       url("/0b1ebaf21ea10772a41e590d053b1304.woff2") format("woff2-variations"),
       url("/0b1ebaf21ea10772a41e590d053b1304.woff2") format("woff2");
}

@font-face {
  font-family: 'Inter var';
  font-weight: 100 900;
  font-style: italic;
  font-named-instance: 'Italic';
  src: url("/e245acf245f150dba035c67dd192c753.woff2") format("woff2 supports variations(gvar)"),
       url("/e245acf245f150dba035c67dd192c753.woff2") format("woff2-variations"),
       url("/e245acf245f150dba035c67dd192c753.woff2") format("woff2");
}

/* --------------------------------------------------------------------------
[EXPERIMENTAL] Multi-axis, single variable font.

Slant axis is not yet widely supported (as of February 2019) and thus this
multi-axis single variable font is opt-in rather than the default.

When using this, you will probably need to set font-variation-settings
explicitly, e.g.

  * { font-variation-settings: "slnt" 0deg }
  .italic { font-variation-settings: "slnt" 10deg }

*/

@font-face {
  font-family: 'Inter var experimental';
  font-weight: 100 900;
  font-style: oblique 0deg 10deg;
  src: url("/221bef3d474edc04008ba4d2d355b7d8.woff2") format("woff2-variations"),
       url("/221bef3d474edc04008ba4d2d355b7d8.woff2") format("woff2");
}

